  constructor(props) {
    super(props);

    this.state = {
      robotList: ["robot1", "robot2"]
    }
  }

  render() {
    return (
      <div className="App">
        <h1>Bot-O-Mat</h1>

        <div className="contentContainer">
          <Button text="Add Robot"/>

          <div className="robotListContainer">

          </div>  

        </div>
      </div>
    );
  }
}

export default App;
